import Editor from "./Editor";
import {Box,styled} from"@mui/material";
const Code = () => {
    return(
        <div>
            <Editor 
                heading = "HTML"
                icon = "/"
            />
            <Editor 
                heading = "CSS"
                icon = "@"
            />
            <Editor 
                heading = "JS"
                icon = "{}"
            />
        </div>
    );
}

export default Code;
